    <div className="nav-container">
      <div className="nav-left">
        <NavLink to="/">
          <img src="./img/logo.png" alt="" className="logo" />
        </NavLink>

        <ul className="movie-drop">
          Films
          <li>Populaire</li>
          <li>À venir</li>
          <li>En ce moment</li>
          <li>Les mieux notés</li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
